                },
    profiles : ['Twitter', 'Instagram','Youtube', 'Facebook'],

    printProfile: () =>{person.profiles.map( profile => {console.log(profile)})}
}

export default function PersonDetails()
{
    return(<>
            <div>{person.name}</div>
            <div>{person.age}</div>
            <div>{person.address.last_line}</div>
            <div>{person.printProfile()}</div>
        </>
    )
}
